  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Detroit
  Lakes Wetland Management District summarizes refuge activities during calendar year
  of 1997. The report begins with a summary of the yearu2019s highlights and climatic
  conditions.  Monitoring and studies are also covered. Habitat restoration of wetlands
  and uplands is described. Habitat management is discussed; topics include grazing,
  haying, farming, prescribed burning, and pest control. The wildlife section of the
  report discusses nesting structures.  Coordination activities, resource protection,
  and public education, recreation, and planning and administration are also discussed.\",\n\t\"license_title\":
